"vs/workbench/parts/codeEditor/electron-browser/accessibility":["現在 `editor.accessibilitySupport` 設定を 'on' に変更しています。","現在 VS Code のアクセシビリティ ドキュメントページを開いています。","VS Code のアクセシビリティ オプションをご利用いただき、ありがとうございます。","ステータス:","スクリーン リーダーで使用するためにエディターを永続的に最適化するように設定するには、Command + E を押してください。","スクリーン リーダーで使用するためにエディターを永続的に最適化するように設定するには、Control + E を押してください。","エディターは、プラットフォーム API を使用してスクリーン リーダーがいつ接続されたかを検出するように設定されていますが、現在のランタイムはこれをサポートしていません。","エディターはスクリーン リーダーの接続を自動検出しました。","エディターは、スクリーン リーダーが接続されると自動的に検出するように構成されていますが、今回は検出できませんでした。","エディターはスクリーン リーダーで使用するために永続的に最適化されるように設定されています。これは `editor.accessibilitySupport` の設定を編集することで変更できます。","エディターはスクリーン リーダー向けに最適化しないように構成されています。","現在のエディターで Tab キーを押すと、次のフォーカス可能な要素にフォーカスを移動します。{0} を押すと、この動作が切り替わります。","現在のエディターで Tab キーを押すと、次のフォーカス可能な要素にフォーカスを移動します。コマンド {0} は、キー バインドでは現在トリガーできません。","現在のエディターで Tab キーを押すと、タブ文字が挿入されます。{0} を押すと、この動作が切り替わります。","現在のエディターで Tab キーを押すと、タブ文字が挿入されます。コマンド {0} は、キー バインドでは現在トリガーできません。","command + H キーを押して、ブラウザー ウィンドウを今すぐ開き、アクセシビリティに関連する他の VS Code 情報を確認します。","Ctrl + H キーを押して、ブラウザー ウィンドウを今すぐ開き、アクセシビリティに関連する他の VS Code 情報を確認します。","Esc キー か Shift+Esc を押すと、ヒントを消してエディターに戻ることができます。","アクセシビリティのヘルプを表示します"],
