"vs/workbench/parts/files/electron-browser/files.contribution":["エクスプローラーを表示","エクスプローラー","表示","テキスト ファイル エディター","バイナリ ファイル エディター","ファイル","ファイルとフォルダーを除外するための glob パターンを構成します。たとえば、ファイル エクスプローラーではこの設定に基づいてファイルとフォルダーの表示や非表示を決定します。","ファイル パスの照合基準となる glob パターン。これを true または false に設定すると、パターンがそれぞれ有効/無効になります。","一致するファイルの兄弟をさらにチェックします。一致するファイル名の変数として $(basename) を使用します。",'言語に対するファイルの関連付け (例 "*.extension": "html") を構成します。これらの関連付けは、インストールされている言語の既定の関連付けより優先されます。',"ファイルの読み取り/書き込みで使用する既定の文字セット エンコーディング。言語ごとに構成することも可能です。","有効な場合、ファイルを開くときに文字セット エンコードを推測します。言語ごとに構成することも可能です。","既定の改行文字。LF の場合には \\n を CRLF の場合には \\r\\n を使用してください。","有効にすると、ファイルの保存時に末尾の空白をトリミングします。","有効にすると、ファイルの保存時に最新の行を末尾に挿入します。","有効にすると、ファイルの保存時に最終行以降の新しい行をトリミングします。","ダーティ ファイルを自動的に保存することはしません。","'files.autoSaveDelay' で構成された時間の経過後に、ダーティ ファイルを自動的に保存します。","エディターがフォーカスを失った時点で、ダーティ ファイルを自動的に保存します。","ウィンドウがフォーカスを失った時点で、ダーティ ファイルを自動的に保存します。","ダーティ ファイルの自動保存を制御します。有効な値: '{0}'、'{1}'、'{2}' (エディターがフォーカスを失います)、'{3}' (ウィンドウがフォーカスを失います)。'{4}' に設定すると、'files.autoSaveDelay' で遅延を構成できます。","ダーティ ファイルの自動保存の遅延をミリ秒単位で制御します。'files.autoSave' が '{0}' に設定されている場合のみ適用されます","ファイル監視から除外するファイル パスの glob パターンを設定します。パターンは絶対パスで一致する必要があります (つまり、適切に一致するには、プレフィックス ** を指定するか、完全パスを指定します\n)。この設定を変更した場合は、再起動が必要になります。始動時に Code が消費する CPU 時間が多い場合は、大きいフォルダーを除外すれば初期の負荷を減らすことができます。","Hot Exit を無効にします。","アプリケーションが閉じると (Windows/Linux で最後のウィンドウが閉じるとき、または workbench.action.quit コマンドがトリガーされるとき (コマンド パレット、キー バインド、メニュー))、Hot Exit がトリガーされます。バックアップされているすべてのウィンドウは、次の起動時に復元されます。",'アプリケーションが閉じると (Windows/Linux で最後のウィンドウが閉じるとき、または workbench.action.quit コマンドがトリガーするとき (コマンド パレット、キー バインド、メニュー))、Hot Exit がトリガーされます。また、フォルダーが開かれているウィンドウについても、それが最後のウィンドウかどうかに関係なく、Hot Exit がトリガーされます。フォルダーが開かれていないウィンドウはすべて、次回の起動時に復元されます。フォルダーのウィンドウをシャットダウン前と同じ状態に復元するには、"window.restoreWindows" を "all" に設定します。',"エディターを終了するときに保存を確認するダイアログを省略し、保存されていないファイルをセッション後も保持するかどうかを制御します。","新しい試験的な File Watcher を使用します。","新しいファイルに割り当てられる既定の言語モード。","エディター","ファイルを保存するときにフォーマットしてください。フォーマッタを使用可能にして、ファイルを自動保存せず、エディターをシャットダウンしないでください。","エクスプローラー","[開いているエディター] ウィンドウに表示されているエディターの数。0 に設定するとウィンドウが非表示になります。","開いているエディターのセクションの高さを要素の数に合わせて動的に調整するかどうかを制御します。","エクスプローラーでファイルを開くとき、自動的にファイルの内容を表示して選択するかどうかを制御します。","ドラッグ アンド ドロップを使用したファイルとフォルダーの移動をエクスプローラーが許可するかどうかを制御します。","ドラッグ アンド ドロップを使用したファイルやフォルダーの移動時にエクスプローラーが確認を求めるかどうかを制御します。","ごみ箱を経由したファイル削除時にエクスプローラーが確認を求めるかどうかを制御します。","ファイルとフォルダーをアルファベット順に名前で並び替えます。フォルダーはファイルの前に表示されます。","ファイルとフォルダーをアルファベット順に名前で並び替えます。ファイルはフォルダーと混交して表示されます。","ファイルとフォルダーをアルファベット順に名前で並び替えます。ファイルはフォルダーの前に表示されます。","ファイルとフォルダーをアルファベット順に拡張子で並び替えます。フォルダーはファイルの前に表示されます。","ファイルとフォルダーを降順に最終更新日で並び替えます。フォルダーはファイルの前に表示されます。","エクスプローラー内のファイルとフォルダーの並び順を制御します。既定の並び順に加えて、'mixed' (ファイルとフォルダーを混交した並び順)、' type' (ファイルの種類順)、' modified' (最終更新日時順)、または 'filesFirst' (フォルダーの前にファイルを並べる) のいずれかの並び順に設定できます。 ","ファイルの装飾に配色を使用するかどうかを制御します。","ファイルの装飾にバッジを使用するかどうかを制御します。"],
